import React from 'react'

const AnimationKeyFrame = () => {
  return (
    <div>
          <h3 className='font-inter font-semibold text-4xl text-black text-center pb-9 animate__animated animate__flipInX animate__slow 1s'>Key PRACTICE </h3>
    </div>
  )
}

export default AnimationKeyFrame
